import React, { Component } from 'react'
import logo from '../logo.svg';
export class GreetClassComponent extends Component {
  render() {
    return (
        <React.Fragment>
            <div>
                <h1>hello guys!!</h1>
                <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Ex fugit veniam laboriosam laudantium amet fuga corporis distinctio quos, iure porro nihil. Facilis maxime rerum iure quaerat optio incidunt officia alias.</p>
            </div>
            <div>
                <h1>hello from div2</h1>
                <img src={logo} className='App-logo' alt='no i'></img>
            </div>
        </React.Fragment>
    
      
    )
  }
}

export default GreetClassComponent
